Information
------------------------------
Malaria kills a child every minute, and disables millions of adults, most of them in Africa. Nearly half the world's population lives in regions affected by malaria. While there has been success in tackling the disease malarial mosquitos are posing a new threat. They've started biting during the day. Judy Aslett reports from Burkina Faso where they're tackling this new menace.

